    load, intra_delay_total, intra_delay_high, intra_delay_med, intra_delay_low = clean_load_delays(load_save,
                                                                                                    waa_intra_delay_total_avg,
                                                                                                    waa_intra_delay_high_avg,
                                                                                                    waa_intra_delay_med_avg,
                                                                                                    waa_intra_delay_low_avg)

    fig, ax1 = plt.subplots(constrained_layout=False)
    ax1.set_yscale('log')
    ax1.plot(load, intra_delay_total,'k--', label="Intra Avg",linewidth=4)
    ax1.plot(load, inter_delay_total,'k', label="Inter Avg",linewidth=4)
    ax1.plot(load, intra_delay_high,'r--', label="Intra High",linewidth=4)
    ax1.plot(load, inter_delay_high,'r', label="Inter High",linewidth=4)
    ax1.plot(load, intra_delay_med,'g--', label="Intra Med",linewidth=4)
    ax1.plot(load, inter_delay_med,'g', label="Inter Med",linewidth=4)
    ax1.plot(load, intra_delay_low,'b--', label="Intra Low",linewidth=4)
    ax1.plot(load, inter_delay_low,'b', label="Inter Low",linewidth=4)

    try:
        ax1.set_xlabel(x_label, fontsize=35)
    except:
        pass
    try:
        ax1.set_ylabel(y_label, fontsize=35)
    except:
        pass
    try:
        ax1.set_xlim(x_lim_begin,x_lim_end)
    except:
        pass
    try:
        ax1.legend(loc=legend_loc, fontsize=20)
    except:
        ax1.legend(loc='upper left', fontsize=20)
    ax1.grid(True, which='major', axis='both')
    ax1.tick_params(axis='both', which='major', labelsize=35)
    ax1.tick_params(axis='both', which='minor', labelsize=35)

    plt.show()

